/**
 * Convert pre-baked data back to typed arrays for WebGPU
 */
export function loadGeometryData() {
    return GEOMETRY_DATA.map(buffer => ({
        ...buffer,
        vertices: new Float32Array(buffer.vertices),
        indices: new Uint32Array(buffer.indices)
    }));
}
